import React from 'react';
import './App.css';
import { Layout } from 'antd';
import LayOut from "./Components/LayOut";

const { Header, Footer, Sider, Content } = Layout;





function App() {
  return (
    <div>
      <Layout>
        <Header>Header</Header>
        <Layout>
          <Content>Content</Content>
          <Sider>Sider</Sider>
        </Layout>
        <Footer>Footer</Footer>
      </Layout>
    </div>
  );
}

export default App;
